import Classes from "./css/RightArticle.module.css"

function RightModels(props)
{
    return (
        <div className={Classes.RightModelsDiv} style={{borderBu}}>
            <div className={Classes.RightModels} style={{backgroundColor : props.color}}></div>
            <p>{props.text}</p>
        </div>
    )
}

export default RightModels
